g: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1236192","type":"CustomJS"},{"attributes":{},"id":"1236089","type":"LinearScale"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"1235818","type":"BoxAnnotation"},{"attributes":{"coordinates":null,"formatter":{"id":"1236127"},"group":null,"major_label_policy":{"id":"1236128"},"ticker":{"id":"1236092"},"visible":false},"id":"1236091","type":"LinearAxis"},{"attributes":{},"id":"1236092","type":"BasicTicker"},{"attributes":{"axis":{"id":"1235767"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1235770","type":"Grid"},{"attributes":{"axis":{"id":"1236091"},"coordinates":null,"group":null,"ticker":null},"id":"1236094","type":"Grid"},{"attributes":{},"id":"1235885","type":"UnionRenderers"},{"attributes":{"coordinates":null,"formatter":{"id":"1236070"},"group":null,"major_label_policy":{"id":"1236071"},"ticker":{"id":"1
